import { Text, View, StyleSheet } from 'react-native'

const App = () => {
  return <View>
    <Text style={styles.colorSty}>你好， react native</Text>
  </View>
}

const styles = StyleSheet.create({
  colorSty: {
    color: "#66 6",
    fontSize: 20
  }
})

export default App;
